import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import OlderVersions from '../src/components/older_versions';
import NewVersion from '../src/components/new_version';
import ChangeVersion from '../src/components/change_version';

class App extends Component {
  render() {
    return (
      <div className="App">

        <OlderVersions style={{marginTop:100}}/>
        <NewVersion/>
        <ChangeVersion/>

      </div>
    );
  }
}

export default App;
